import './App.css';
import React, { useState } from 'react';


function App() {
  const[notes, setNotes] = useState(['a', 'b', 'c', 'd', 'e']);
  const [value, setValue] = useState("");
  const map = notes.map((elem, index) => {
      return <li key = {index}>{elem}</li>
  })

  return <div>
      <ul>{map}</ul>
      <input  value = {value}/>
  </div>
}
export default App;
